import React from 'react'

const ReserveinMsg = ({hour, showBtn, otherHour}) => {
const findIfSelected = otherHour.find(x => x === hour.hour)
const borderStyle = {border: findIfSelected? "2px solid #990000" : "none"}

  return (
    <div style={{...borderStyle}} onClick={showBtn}> Hour: {hour.hour}</div>
  )
}

export default ReserveinMsg
